import React from "react";

function CryptoCoin({coin}){
    return (
        <div className="CryptoCoin">
            <h2>{coin.name}</h2>
            <h3>{coin.current_price}</h3>
            <img src={coin.image}></img>
        </div>
    )
}

export default CryptoCoin;
